// src/pages/VibrationalIntelligence/ProductCompendium.jsx
import React from 'react';
import HeroSection from '../../components/HeroSection';
import PageLayout from '../../components/PageLayout';
import InfoCard from '../../components/InfoCard';

const ProductCompendium = () => {
  return (
    <div className="info-page-container">
      <div className="multicolor-border">
        <h1 className="text-3xl font-bold mb-4">Product Compendium</h1>
        <p>
          The Product Compendium is a curated catalog of all vibrational and holistic wellness products offered
          through the Journey to Enlightenment platform. Each item is carefully selected based on energetic
          frequency, natural composition, and spiritual alignment.
        </p>
        <p>
          From herbal supplements and crystal tools to sea moss blends and detox kits, every product has a
          documented energetic profile and purpose. This compendium helps users make informed choices aligned
          with their healing goals.
        </p>
        <p>
          Explore and compare each offering by category, use case, vibrational range, and origin, ensuring that
          wellness decisions are empowered by both ancient wisdom and modern research.
        </p>
      </div>
    </div>
  );
};

export default ProductCompendium;
